import React from 'react'
import { Link, animateScroll as scroll } from "react-scroll";

const Menu = () => {
    const front_navbar_items = [
        { name: "Home", icon: "", path: "home" },
        { name: "About me", icon: "", path: "about" },
        { name: "PortFolio", icon: "", path: "portfoilo" },
        { name: "Blog", icon: "", path: "blog" },
        { name: "Contact", icon: "", path: "contact" },
    ]
    return (
        <div className="menu-items d-flex justify-between align-center flex-wrap">

            {
                front_navbar_items.map((item, i) => (
                    <div className="menu-item" key={i}>
                        Shop Now
                    </div>
                ))
            }
        </div>
    )
}

export default Menu
